import React, { Component } from 'react'

import '../style/perktree.scss';
import image_url from '../assets/404Code.jpg'

export default class Perklevel extends Component {

    constructor(props) {
        super(props);
    }


    render() {
        return (
            <li className="perk-level"><img src={image_url} alt="" className="perk-image"/></li>
        )
    }
}
